const logo = "data:image/png;base64,";
const br = "data:image/png;base64,";

let clienteResumido = null;
let itensResumido = [];

const formClienteResumido = document.getElementById('formClienteResumido');
const formItensContainerResumido = document.getElementById('formItensContainerResumido');

const formItensResumido = document.getElementById('formItensResumido');
const listaItensResumido = document.getElementById('listaItensResumido');

formClienteResumido.addEventListener('submit', function (e) {
  e.preventDefault();
  const nome = document.getElementById('nomeClienteResumido').value.trim();
  const endereco = document.getElementById('enderecoClienteResumido').value.trim();
  const contato = document.getElementById('contatoClienteResumido').value.trim();

  if (!nome || !endereco) {
    alert('Nome e endereo so obrigatrios!');
    return;
  }

  clienteResumido = { nome, endereco, contato };
  formClienteResumido.style.display = 'none';
  formItensContainerResumido.style.display = 'block';
});

formItensResumido.addEventListener('submit', function (e) {
  e.preventDefault();

  const item = {
    descricao: document.getElementById('descricaoResumido').value.trim(),
    medidas: document.getElementById('medidasResumido').value.trim(),
    vidro: document.getElementById('vidroResumido').value.trim(),
    corAluminio: document.getElementById('corAluminioResumido').value.trim(),
    corFerragens: document.getElementById('corFerragensResumido').value.trim(),
    qtd: parseInt(document.getElementById('qtdResumido').value),
    imagem: br
  };

  itensResumido.push(item);

  // Atualiza lista visual
  const li = document.createElement('li');
  li.textContent = `${item.descricao} - ${item.medidas} - ${item.vidro} - ${item.qtd}`;
  listaItensResumido.appendChild(li);

  formItensResumido.reset();
});

// === BOTO GERAR PDF ===
document.getElementById('gerarPDFBtnResumido').addEventListener('click', function () {
  if (itensResumido.length === 0) {
    alert('Adicione pelo menos um item antes de gerar o PDF.');
    return;
  }
  console.log(itensResumido, "passei pelo IF");
  gerarPDF();
});

// ======================================================
// Funo para gerar PDF
// ======================================================
function gerarPDF() {
  let total = 0;

  const itensFormatados = itensResumido.map((item, i) => {
    let altura = 0;
    let largura = 0;
    const medidasInput = item.medidas.trim().toLowerCase();
    const medidas = medidasInput.split('x').map(m => parseFloat(m.trim()));

    if (medidas.length === 2) {
      altura = medidas[0] / 1000;  // mm  metros
      largura = medidas[1] / 1000; // mm  metros
    }

    const area = altura * largura;
    console.log(medidas)
    total = document.getElementById('valorTotalResumido').value;

    return {
      columns: [
        {
          width: '*',
          stack: [
            { text: `ITEM ${i + 1}`, style: 'itemHeader' },
            { text: item.descricao, bold: true },
            `Medidas: ${item.medidas} - rea total: ${area.toFixed(2)} m`,
            `Vidro: ${item.vidro}`,
            `Cor do Alumnio: ${item.corAluminio}`,
            `Cor das Ferragens: ${item.corFerragens}`,
            `Quantidade: ${item.qtd}`,
          ]
        },
        {
          width: 100,
          image: item.imagem,
          fit: [100, 100],
          alignment: 'right',
          margin: [10, 0, 0, 0]
        }
      ],
      columnGap: 10,
      margin: [0, 0, 0, 20]
    };
  });

  // ======================================================
  // Definio do PDF
  // ======================================================
  const docDefinition = {
    pageSize: 'A4',
    pageMargins: [40, 150, 40, 60],

    background: function (currentPage, pageSize) {
      return {
        image: br,   // usa a chave definida em images
        width: 610,      // ajusta o tamanho
        opacity: 0.1,    // deixa translcido
        alignment: 'center',
        margin: [0, 80, 0, 0] // centraliza verticalmente
      };
    },

    header: {
      margin: [120, 40, 130, 20],
      columns: [
        { image: 'logo', width: 120 },
        {
          stack: [
            { text: 'Endereo: Rua Goinia, 2215 - Nova Braslia, Ji-Paran RO, 76908-672', margin: [0, 0, 0, 2] },
            { text: 'CNPJ: 05.858.611/0001-99', margin: [0, 0, 0, 2] },
            { text: 'E-mail: contatokriiger@gmail.com', margin: [0, 0, 0, 2] },
            { text: 'Incio: (69) 9 9956-7263', margin: [0, 0, 0, 2] },
            { text: 'Wlliton: (69) 9 9373-1026' }
          ],
          relativePosition: { x: 0, y: 15 },
          fontSize: 11,
          alignment: 'left'
        }
      ],
      columnGap: 50
    },

    footer: function (currentPage, pageCount) {
      return {
        margin: [40, 0, 40, 0],
        columns: [
          { text: "Obrigado pela preferncia!", alignment: 'left', fontSize: 9 },
          { text: currentPage.toString() + ' / ' + pageCount, alignment: 'right', fontSize: 9 }
        ]
      };
    },

    content: [
      {
        columns: [
          { text: `${clienteResumido.nome}`, bold: true, style: 'nomeCliente' },
          { text: 'ORAMENTO', style: 'orcamentoCliente' },
        ]
      },
      {
        columns: [
          { text: `Endereo: ${clienteResumido.endereco}`, fontSize: 11 },
          { text: `Data: ${new Date().toLocaleDateString('pt-BR')}`, fontSize: 11, alignment: 'right' }
        ]
      },
      { text: `Contato: ${clienteResumido.contato}`, margin: [0, 0, 0, 20], fontSize: 11 },

      // PRODUTOS com retngulo arredondado
      {
        stack: [
          {
            canvas: [
              { type: 'rect', x: 0, y: 0, w: 520, h: 30, r: 10, color: '#152d20' }
            ]
          },
          { text: 'PRODUTOS', alignment: 'center', color: '#e5e1de', bold: true, fontSize: 16, margin: [0, -24, 0, 10] }
        ],
        margin: [0, 10, 0, 10]
      },

      // itens do oramento
      ...itensFormatados.flat(),

      { text: `TOTAL: R$ ${total}`, style: 'total' },
      { text: 'Observaes: Valor com material e mo de obra.', margin: [0, 20, 0, 0] }
    ],

    styles: {
      itemHeader: { bold: true, margin: [0, 10, 0, 5] },
      total: { bold: true, fontSize: 14, alignment: 'right', margin: [0, 20, 0, 0] },
      nomeCliente: { bold: true, fontSize: 16, alignment: 'left', margin: [0, 50, 0, 10] },
      orcamentoCliente: { bold: true, fontSize: 16, alignment: 'right', margin: [0, 50, 0, 10] }
    },

    images: {
      logo: logo
    }
  };

  pdfMake.createPdf(docDefinition).download('orcamento.pdf');
}